import axios from 'axios'
import { host,trainAgentHost } from '../../config';

export const goToWizardConfig = (projet,history) => {
    return (dispatch) => {
        
        console.log("Go To Wizard Config =>", projet);

        // Detect intent Type 
        let intentDetection = projet.post.idPost === projet.post.page.idPage;

        console.log("Intent type found", intentDetection);

        dispatch({
            type: 'FROM_MY_AGENTS_TO_STEP_3_WIZARD',
            payload: intentDetection ? "generic" : "default",
            payload1: 2,
            payload2: projet._id,

            // wizardIntentType: intentDetection ? "generic" : "default",
            // wizardStep: 2,
            // wizardIdProject: projet._id,
        });
        history.push('/home/auto-wizard');

        // return axios.get(host + `/api/v1/secure/pages/get/project/${Page.id}`,{
        //     headers: {
        //         'authorization': 'Bearer ' + localStorage.getItem('authtoken')
        //     }
        // })
        // .then(res => {
        //     console.log('getProjectByPage post APi Response =>', res.data.data);

        //     dispatch({
        //         type: 'GET_PROJECT_BY_PAGE',
        //         payload: res.data.data,
        //     });
        // })
        // .catch((err) => console.log("getProjectByPage post Api error  =>", err) )
    }
};

export const getProjectByPage = (Page) => {
    return (dispatch) => {
 
        return axios.get(host + `/api/v1/secure/pages/get/project/${Page.id}`,{
            headers: {
                'authorization': 'Bearer ' + localStorage.getItem('authtoken')
            }
        })
        .then(res => {
            console.log('getProjectByPage post APi Response =>', res.data.data);

            dispatch({
                type: 'GET_PROJECT_BY_PAGE',
                payload: res.data.data,
            });
        })
        .catch((err) => console.log("getProjectByPage post Api error  =>", err) )
    }
};
